const toggler=document.querySelector(".navbar-toggler");toggler.addEventListener("click",function(e){const o=this.parentElement,t=o.querySelector(".navbar-collapse");t.classList.toggle("show"),window.innerWidth<576&&document.querySelector("body").classList.toggle("scroll-off")});const togglerClose=document.querySelector(".navbar-mobile-header .close");togglerClose.addEventListener("click",e=>{const o=document.querySelector(".navbar-collapse");o.classList.remove("show"),window.innerWidth<576&&document.querySelector("body").classList.remove("scroll-off")});